Amy Brooke is a student at ZZ Academy and Courtney Taylor is new. Both are witches and are made fun of by the others even though they don't know the truth. Even their teacher joins the taunting! But when the name-calling and saber-rattling becomes too much for the girls to handle, they throw caution to the wind and bust out all their best spells to teach their teacher a lesson...
